		function apiJSON(callback) {

			var xobj = new XMLHttpRequest();
			// true parameter denotes asynchronous
			xobj.open('GET', "data.json", true);
			xobj.onreadystatechange = function () {
				if (xobj.readyState == 4 && xobj.status == "200") {
					// This marks that the response has been successfully retrieved from the server
					// Utilize callback
					// callback(xobj.responseText);

					let userObj = JSON.parse(xobj.response);
					const searchValue = document.getElementById("no_ujian").value.toUpperCase();

					for (let i = 0; i < userObj.length; i++) {
						if (userObj[i].no_ujian.toUpperCase() == searchValue) {
							// Redirect ke link lain apabila data ditemukan
							// alert("Data ditemukan!");
							window.location.href = service[i].link;
							// break;
						}
					}

					userObj.clear();
				}
			};
			xobj.send(null);
		}
